INSERT INTO `posts` (`postID`, `title`, `post`, `tags`, `date_added`, `userID`, `author`, `active`, `views`) VALUES
(2, 'Which IDE(Integrated development environment) is the best?', 'There is no answer for this question. The IDE highly depends of that which programming language you will use. \nSome of the most used Integrated development environments are:\n\nMS Visual Studio \n\nVisual Studio has an advantage when it comes to programming. This IDE is mostly used by corporate programmers to produce .NET code.\n\nEclipse\n\nThis is the best alternative if you are not a big fan of Microsoft’s Visual Studio. The interface is a lot cleaner and concise than Visual Studio and the languages that are possible to use extend past the .Net Framework.\n\nNetBeans\n\nThis program is extensible and free, and it compiles code which is a bonus. When installing Netbeans it comes with a Java server called GlassFish that you could deploy on your computer for your testing environment\n\ngedit\n\nGedit is the official editor of the gnome desktop and comes installed once the system is setup. Very useful for the user that is casually editing code and not undertaking major projects.\n\nThere are tons IDEs that can be used for programming. Make a little research and find that is the best for you.\n', 'IDE', '2014-08-23 15:35:01', 0, 'admin', 1, 20),
(3, 'The Most Important Skill In programming', 'More than ever, you need to have coding skills. Not just to make the things happened but you need to learn to write good quality code. The best quality code is that you understand whit one blink.\n\nattention to detail: Considering the matter of programming details are playing a significant and very important role. So if the respective programming language says it is necessary to declare and specify variables before using them, you have to do so. However, if the programming language requires the usage of parentheses, brackets and square brackets, you have to do so as well.\n\nAnother important skill is to be adaptive. Adaptive skills come from adaptive behaviour, or the conceptual, social, and practical skills that individuals have learned and use in their daily lives. These skills, in addition to Intelligence Quotient (IQ) are very useful not just in programming but in real life too.\n', 'skill,programming', '2014-08-23 15:35:01', 0, 'admin', 1, 19),
(4, 'Where will be Vesko Marinov`s next concert', 'We do not know but we are waiting with impatience. ', 'marinov,veselin', '2014-07-22 17:26:57', 0, 'admin', 1, 1),
(5, 'Sex after 60?', 'If you believe the studies, there is a LOT of action going on between the sheets among those over 60 -- and even among those over 70 and 80. A large body of research shows that arousal continues well into old age. Specifically, data from the University of Chicago''s National Social Life, Health and Aging Project presented in the New England Journal of Medicine revealed that many men and women remain sexually active even when in their 70s and 80s.', 'special treatment', '2014-07-21 17:27:13', 0, 'admin', 1, 3),
(6, 'Is there lack of skilled technology specialists?', 'The lack of IT and digital skills continues to be a real problem, despite technology workers being viewed as among the most highly qualified sectors. According to a recent report by e-skills, the Sector Skills Council for Business and Information Technology, over the next ten years the digital sector will become the powerhouse of the economy.', 'technology,specialists', '2014-08-22 21:26:38', 0, 'admin', 1, 1),
(7, 'What is the best programming language?', 'There is no right answer on that question. You can try the most used languages like Java, C, C++, Python, C#, PHP, JavaScript, Ruby, R, MATLAB, Perl, SQL, Assembly, HTML, Visual Basic, Objective-C, Scala, Shell, Arduino and can choose the best for you.', 'programming,language', '2014-08-22 22:26:38', 123, 'admin', 1, 3);

